window.bookSummaryJSON = "<p>Holly Boldt is a witch with a problem. Make that lots of problems. </p> <p>Following her banishment from the supernatural world, she is thrust into a halfway house for paranormal misfits like her. With a warring shifter and vampire roommate and a cantankerous ghost landlady, she's got a full plate. </p> <p>Unsurprisingly, she finds solace in the human residents of the small coastal town and begins to feel like maybe - just maybe - she could finally have a normal life. Until her best friend is accused of a murder she didn't commit. </p> <p>Holly is forced to use her magic to solve the crime before she loses her friend, not to mention her last shred of sanity!</p>"; 
